  [],\n\t\"revision_timestamp\": \"2016-07-27T22:58:06.744167\",\n\t\"name\": \"summary-of-2000-waterbird-production\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The focus of this yearu2019s waterbird
  production monitoring was on the five species of waterfowl nesting on the refuge.
  They are Canada goose, wood duck, mallard, black duck and hooded merganser. After
  two years of drought, water levels were dramatically higher at the beginning of
  the nesting season and all through the brood rearing period. All wetlands were full
  throughout the period. This is the first time in four years that water levels remained
  high through the summer.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
